using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace MaximumNumberOfBalloons
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Console.WriteLine(MaximumNumberOfBalloons(""));
            Console.WriteLine(MaximumNumberOfBalloons(""));
            Console.WriteLine(MaximumNumberOfBalloons(""));
            Console.WriteLine(MaximumNumberOfBalloons("nlaebolko"));
            Console.WriteLine(MaximumNumberOfBalloons("loonbalxballpoon"));
            Console.WriteLine(MaximumNumberOfBalloons("leetcode"));
        }
        public static int MaximumNumberOfBalloons(string text)
        {
            var balloon = "balloon";
            int counter = 0;

            for (int r = 0; r < 15; r++)
            {
                for (int i = 0; i < text.Length; i++)
                {
                    if (balloon.Contains(text[i]))
                    {
                        var textIndex = text.IndexOf(text[i]);
                        var balIndex = balloon.IndexOf(text[i]);

                        text = text.Remove(textIndex, 1);
                        balloon = balloon.Remove(balIndex, 1);
                        i--;
                    }

                    if (balloon.Length == 0)
                    {
                        balloon = "balloon";
                        counter++;
                    }
                }
            }
            return counter;
        }
    }
}
